function GetKnownProducts(ID)
return [[
<Property name="KnownProducts" value="]] .. ID .. [[" />
]]
end

function GetBaseBuildingObject(ID)
return [[ 
    <Property name="Objects" value="GcBaseBuildingEntry" _id="]] .. ID .. [[">
      <Property name="BuildableOnFreighter" value="true" />
      <Property name="BuildableInShipDecorative" value="true" />
      <Property name="BuildableOnPlanet" value="true" />
    </Property>
]]
end

function GetBaseBuildingPart(ID)
return [[
    <Property value="GcBaseBuildingPart" _id="]] .. ID .. [[">
      <Property name="StyleModels">
				<Property name="StyleModels" value="GcBaseBuildingPartStyleModel" _index="0">
          <Property name="Inactive" value="TkModelResource">
            <Property name="Filename" value="" />
          </Property>
        </Property>
      </Property>
    </Property>
]]
end

function GetSnapGroupPart(ID, MODELS)
STYLEMODEL_INJECT = ""
for _k,l in pairs(MODELS) do
	STYLEMODEL_INJECT = STYLEMODEL_INJECT .. [[
				<Property name="StyleModels" value="GcBaseBuildingPartStyleModel">
          <Property name="Style" value="GcBaseBuildingPartStyle">
            <Property name="Style" value="]] .. l["Style"] .. [[" />
          </Property>
          <Property name="Model" value="TkModelResource">
            <Property name="Filename" value="]] .. l["Filename"] .. [[" />
          </Property>
          <Property name="Inactive" value="TkModelResource">
            <Property name="Filename" value="" />
          </Property>
        </Property>
]]
end
return [[
    <Property value="GcBaseBuildingPart" _id="]] .. ID .. [[" _overwrite="true">
      <Property name="ID" value="]] .. ID .. [[" />
      <Property name="StyleModels">
	  ]] .. STYLEMODEL_INJECT .. [[
      </Property>
    </Property>
]]
end

